import React, { useState } from "react";
import { Button, Offcanvas } from "react-bootstrap";
import { Link } from "react-router-dom";
import hamburgIcon from "./assets/Hamburg.png";
import "./index.css";

function Hamburg() {
  const hoverStyle = {
    color: "black"
  };
  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <div>
      <img
        className="p-5"
        src={hamburgIcon}
        onClick={handleShow}
        alt={"hamburger icon"}
      />

      <Offcanvas show={show} onHide={handleClose} placement="top">
        <Offcanvas.Header closeButton>
          <Offcanvas.Title>team waffles</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body className="d-flex flex-row row">
          <Link
            style={{ textDecoration: "none" }}
            to="/"
            className="text-end text-muted text-center col"
            onClick={handleClose}
          >
            <h2 className="textColor">Home</h2>
          </Link>
          <Link
            style={{ textDecoration: "none" }}
            to="/Dash"
            className="text-end text-muted text-center col"
            onClick={handleClose}
            onHover={hoverStyle}
          >
            <h2 className="textColor"> My Dashboard</h2>
          </Link>
          <Link
            style={{ textDecoration: "none" }}
            to="/FileP"
            className="text-end text-muted text-center col"
            onClick={handleClose}
          >
            <h2 className="textColor">My cards</h2>
          </Link>
          <Link
            style={{ textDecoration: "none" }}
            to="/FileP"
            className="text-end text-muted text-center col"
            onClick={handleClose}
          >
            <h2 className="textColor"> File processing</h2>
          </Link>
        </Offcanvas.Body>
      </Offcanvas>
    </div>
  );
}

export default Hamburg;
